import React, { Component } from "react";

export class TableRegister extends Component {

    state= {
        tablename:"",
        capacity:"",
        isAvailable:true,
        location: ""
    }

    handleChange = (event) => {
        this.setState({ [event.target.name]: event.target.value });
      };

  render() {

    return (
      <div className="container">
        <h2>Table register Page</h2>
        <div className="row">
            <form className="col s12">

            {/** Table Name */}
            <div className="row">
              <div className="input-field col s12">
                <input
                  name="tablename"
                  value={this.state.tablename}
                  onChange={(e) => this.handleChange(e)}
                  id="tablename"
                  type="text"
                  className="validate"
                />
                <label className="active">
                  Table Name
                </label>
                <span
                  className="helper-text"
                  data-succeuss="right"
                />
              </div>
            </div>

            {/**For Table Capacity  */}
            <div className="row">
              <div className="input-field col s12">
                <input
                  name="capacity"
                  value={this.state.capacity}
                  onChange={(e) => this.handleChange(e)}
                  id="capacity"
                  type="text"
                  className="validate"
                />
                <label htmlFor="capacity">Capacity</label>
                <span
                  className="helper-text"
                  data-succeuss="right"
                />
              </div>
            </div>

            {/**For Table Location  */}
            <div className="row">
              <div className="input-field col s12">
                <input
                  name="location"
                  value={this.state.location}
                  onChange={(e) => this.handleChange(e)}
                  id="location"
                  type="text"
                  className="validate"

                />
                <label htmlFor="capacity">Location</label>
                <span
                  className="helper-text"
                  data-succeuss="right"
                />
              </div>
            </div>

            </form>
        </div>
      </div>
    );
  }
}

export default TableRegister;
